import './App.css';
import Form from './Form';
import Setting from './setting'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (

    // <div id="yoyo">
    // <Form/>
    // </div>
    <Router>
      <Setting/>
    <Switch>
          <Route path="/Form">
                 <Form />
          </Route>
          <Route path="/">
                 <Setting />
          </Route>
    </Switch>
    </Router>
  )
}

export default App;
